import React, { Component } from "react";
import DataTablesComp from './DataTableComp';
const columns = [];
const COLUMN_MAPPING = {
  'LD ID' : 'id',
  'STK'   : 'item_attributes.diamond#stock_number.trans',
  'CERT'  : 'item_attributes.diamond#cert_number.trans',
  'AGING' : 'aging_group',
  'SHP'   : 'item_attributes.diamond#shape.trans',
  'COL'   : 'item_attributes.diamond#color.trans',
  'CLAR'  : 'item_attributes.diamond#clarity.trans',
  'CTS'   : 'item_attributes.gem#carats.trans',
  'MILKY' : 'item_attributes.diamond#milky.trans',
  'SHADE' : 'item_attributes.diamond#shade.trans',
  'MAKE'  : 'item_attributes.diamond#make.trans',
  'FLOUR' : 'item_attributes.diamond#fluor.trans',
  'BIC'   : 'item_attributes.diamond#black_in_center.trans',
  'BIS'   : 'item_attributes.diamond#black_in_side.trans',
  'WIC'   : 'item_attributes.diamond#white_in_center.trans',
  'WIS'   : 'item_attributes.diamond#white_in_side.trans',
  'LAB'   : 'item_attributes.diamond#cert.trans',
  'RAP %' : 'item_attributes.diamond#rap_percent.trans',
  '$/CT'  : 'item_attributes.gem#price_per_carat.trans',
  'Total' : 'sell_offer_cents',
  }
  Object.entries(DEFAULT_COLUMNS).map(([key, mapper]) => {
    columns.push({
      name: key,
      data: mapper
    })
  })

class MyDataTable extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: this.props.data,
      columns: COLUMN_MAPPING
    };
  }
  render() {
    return (
      <div>
        <DataTablesComp columns={this.state.columns} data={this.state.data}/>
      </div>
    );
  }
}
export default MyDataTable;
